import React from 'react';

function Serices(props) {
  return (
    <div>
      <img src={props.img}/>
      <h3>{props.title}</h3>
      <p>{props.description}</p>
      <button>{props.btnText}</button>
    </div>
  );
}

function App() {
  return (
    <div>
      <h1>Pro Ride Coaching</h1>
      <Serices img="Sara" title="" />
    </div>
  );
}

export default App;
